 import App from './App.jsx';
 import {Home} from './Home.jsx';
import './info.css'
import {BrowserRouter, Routes, Route  } from 'react-router-dom';
import {First} from './Card.jsx';
export const Info =(props)=>{
  const data = useContext(First);


   return (
    
<BrowserRouter>
    <Routes>
        <Route path="/" element={<App />} />
        <Route path="/detail/:id" element={<Home  data={data} />} />
        
       
    </Routes>
    </BrowserRouter>


  );
      
      
 

}
